        const urlParams = new URLSearchParams(window.location.search);

    const channelId = getUrlParameter('id');

    if (confirm("Join Our Telegram Channel @livecrichdofficial")) {
        window.location.href = "https://telegram.me/livecrichdofficial";
    }

    // Check if the channel ID exists in the channelData
    let manifestUri, drmKeys;
    if (channelId && channelData[channelId]) {
        const channel = channelData[channelId];
        manifestUri = channel.file;
        drmKeys = {
            [channel.drm.clearkey.keyId]: channel.drm.clearkey.key
        };
    } else {
        console.error('Channel not found or invalid channel ID');
